import ascap from "./images/ASCAP.png";
import bmi from "./images/BMI.png";
import gmr from "./images/GMR.png";
import sesac from "./images/SESAC.png";
import hfa from "./images/HFA.png";
import "./PROs.css";

const PROs = () => {
  return (
    <div>
      <div className="item1">
        <h2>ASCAP</h2>
        <img src={ascap} alt="" />
      </div>
      <div className="item2">
        <h2>BMI</h2>
      </div>
      <div className="item3">
        <img src={bmi} alt="" />
      </div>
      <div className="item4">
        <h2>GMR</h2>
        <img src={gmr} alt="" />
      </div>
      <div className="item5">
        <h2>SESAC</h2>
        <img src={sesac} alt="" />
      </div>
      <div className="item6">
        <h2>HFA</h2>
        <img src={hfa} alt="" />
      </div>
    </div>
  );
};

export default PROs;
